import React from 'react';
import Creatediv from './creatediv';

export default class extends React.Component{
    state={
        x:[0, 0, 0,
            0, 0, 0,
            0, 0, 0],
        turn:'X'
    }
    clickhandler = (index) => {
        let newarr = this.state.x;
        newarr[index] = this.state.turn;
        if(turn)
        this.setState({x:newarr, turn})
    }
    render(){
        return(
            this.state.x.map((element, index) => {
                return <Creatediv element={element} index={index} turn={this.state.turn} />
            })
        );
    }


}
